  `ragioneSociale` varchar(45) NOT NULL,
  `provinciaSedeLegale` varchar(25) NOT NULL,
  `cittaSedeLegale` varchar(45) NOT NULL,
  `viaSedeLegale` varchar(45) NOT NULL,
  `nCivicoSedeLegale` varchar(7) NOT NULL,
  `capSedeLegale` char(5) NOT NULL,
  PRIMARY KEY (`idUtente`),
  CONSTRAINT `IdUtenteRivenditore` FOREIGN KEY (`idUtente`) REFERENCES `utente` (`idUtente`) ON DELETE CASCADE ON UPDATE CASCADE
